
-- PERSON tablosu için:
CREATE TABLE PERSON(
ID INT IDENTITY(1,1),
CODE VARCHAR(50),
TCNUMBER VARCHAR(11),
NAME_ VARCHAR(50),
SURNAME VARCHAR(50),
GENDER VARCHAR(1),
BIRTHDATE DATE,
INDATE DATE,
OUTDATE DATE,
DEPARTMENTID INT,
POSITIONID INT,
PARETNPOSITIONID INT,
MANAGERID INT,
TELNR VARCHAR(20),
SALARY FLOAT
CONSTRAINT PK_PERSON PRIMARY KEY CLUSTERED (ID ASC))


-- DEPARTMENT tablosu için:
CREATE TABLE DEPARTMENT(
ID INT IDENTITY(1,1),
DEPARTMENT VARCHAR(50)
CONSTRAINT PK_DEPARTMENT PRIMARY KEY CLUSTERED (ID ASC))


-- POSITION tablosu için:
CREATE TABLE POSITION(
ID INT IDENTITY(1,1),
POSITION VARCHAR(50)
CONSTRAINT PK_POSITION PRIMARY KEY CLUSTERED (ID ASC))

